import React from 'react';
import { connect } from 'react-redux';
import todoListContainer from '../containers/todosList.container';
import { PropTypes } from 'prop-types';

const TodosTable = ({todoList}) => {
    const printTable = (todoList) => {
        if (!todoList.length) return ;
        else {
            return todoList.map(todo => {
                return (
                    <tr key={todo._id}>
                        <td>{todo.todoDescription}</td>
                        <td>{todo.todoResponsible}</td>
                        <td>{todo.todoPriority}</td>
                        <td>{todo.todoCompleted}</td>
                    </tr>
                )
            })
        }
    }

    return (
        <table className='table table-hover'>
                <thead>
                    <tr>
                        <th>Description</th>
                        <th>Responsible</th>
                        <th>Priority</th>
                        <th>Completed</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {printTable}
                </tbody>
            </table>
    )
}

TodosTable.protypes = {
    todoList: PropTypes.array,
}

export default connect(todoListContainer.mapStateToProps)(TodosTable);
